import React from "react";

import img from '../Assets/sushi.jpg'

const Header = () => {
    return (
        <>
            <header>
                <h1>Япона кухня</h1>
                <button>Корзина</button>
            </header>
            <div>
                <img src={img} alt="" />
            </div>
        </>
    )
}

export default Header;
